deactivateUser = async (req: IAuthorizedRouteReq, res: Response) => {
  // cancels subscription for and wipes user data from stripe and firestore
  const { authId } = req;
  const usersRef = firebase.firestore().collection('users');
  const stripeRef = firebase.firestore().collection('stripe');

  try {
    const data = await getUser(authId);
    const { stripeCustId, stripeSubscriptonId } = data;
    const deletedSubscription = await stripe.subscriptions.del(
      stripeSubscriptonId
    );

    await stripeRef.doc(stripeCustId).delete();
    await usersRef.doc(authId).delete();
    firebase.auth().deleteUser(authId);

    res.send({ deletedSubscription });
  } catch (error) {
    res.status(400).json({
      error
    });
  }
}

getUser = async (uuid: string) => {
  const usersRef = firebase.firestore().collection('users');
  const user = await usersRef.doc(uuid).get();
  return user.data();
}

setAddress = async (req: IAuthorizedRouteReq, res: Response) => {
  // sets address for user in firestore
  const { authId } = req;
  const { address } = req.body;

  try {
    await updateUser(authId, { address });
    res.send({ address });
  } catch (error) {
    console.log(error);
    res.status(400).json({
      error
    });
  }
}

updateUser = async (uuid: string, data: any) => {
  const usersRef = firebase.firestore().collection('users');
  await usersRef.doc(uuid).update(data);
}

paymentMethodID = async (req: IAuthorizedRouteReq, res: Response) => {
  // sets card for user in stripe
  const { authId } = req;

  try {
    const user = await getUser(authId);
    const intent = await stripe.setupIntents.create({
      customer: user.StripeCustId
    });
    res.send({ clientSecret: intent.client_secret });
  } catch (error) {
    res.status(400).json({
      error
    });
  }
}

updateSubscription = async (req: IAuthorizedRouteReq, res: Response) => {
  const { authId } = req;

  try {
    const data = await getUser(authId);
    const subscription = await stripe.subscriptions.retrieve(
      data.stripeSubscriptonId
    );
    const updatedSubscription = await stripe.subscriptions.retrieve(
      data.stripeSubscriptonId
    );

    const invoice = subscription.latest_invoice as Stripe.Invoice;
    const paymentIntent = invoice.payment_intent as Stripe.PaymentIntent;

    res.send({
      subscriptionId: updatedSubscription.id,
      clientSecret: paymentIntent.client_secret
    });
  } catch (error) {
    console.log(error);
    res.status(400).send({ error });
  }
}

activateAccount = async (req: IAuthorizedRouteReq, res: Response) => {
  const { authId } = req;

  try {
    const user = await getUser(authId);
    if (user.expiration <= moment().unix()) {
      res.status(400).send({ error: 'expired' });
      return;
    }

    const domain = psl.get(domainFromUrl(req.body.url));
    if (user.mailslurp_id === '') {
      await createInbox(authId, user.email);
    }
    user.card_usage.push(domain);
    updateUser(authId, { card_usage: user.card_usage });

    res.send({ email: user.proxy_email, card_token: user.card_token });
  } catch (error) {
    console.log(error);
    res.status(400).send({ error });
  }
}

