userHasPaid = async (req: IAuthorizedRouteReq, res: Response) => {
  const { authId } = req;

  try {
    const user = await getUser(authId);

    if (user.expiration <= moment().unix()) {
      res.send({ hasPaid: false });
    } else {
      res.send({ hasPaid: true });
    }
  } catch (error) {
    res.status(400).send({ error });
